import React from "react";

function NovasPesquizas(state){
    return(
        <div className="NovasPesquisas">
            <a href={state.element.link}>
            <img src={state.element.image}/>
            </a>
            <p>{state.element.descricao}</p>
            <hr/>
        </div>
    )
}

export default NovasPesquizas
